La salud mental está abandonada Soy suicida y sé lo mal que se pasa. 
Soy suicida porque creo que es como un adicto. Yo vi la luz en la boca del pozo en el que estaba y decidí salir, trepando sola, sin ayuda, mientras la sanidad trataba de taparlo...

É um clichê romântico e triste
Vai ver, se matou e o paraíso não existe 🎧
